package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import com.fasterxml.jackson.databind.annotation.JsonDeserialize;import com.fasterxml.jackson.databind.annotation.JsonSerialize;import com.rongke.utils.DateJsonDeserializer;import com.rongke.utils.DateJsonSerializer;import org.springframework.format.annotation.DateTimeFormat;import java.io.Serializable;import java.util.Date;/** * @UserPhoneRecord * @用户通话记录(user_phone_record) * @version : Ver 1.0 */@TableName("user_phone_record")public class UserPhoneRecord implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 * @备注:	 * @字段:user_id BIGINT(19)	 */	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long userId;	/**	 * 备注:	 */	@TableField(exist = false)	private User user;	/**	 * @备注:任务id	 * @字段:task_id YEAR(0)	 */	private java.lang.String taskId;	/**	 * @备注:	 * @字段:phone VARCHAR(13)	 */	private String phone;	/**	 * @备注:	 * @字段:phone VARCHAR(13)	 */	private String connTimes;	/**	 * @备注:	 * @字段:phone VARCHAR(13)	 */	private String commFee;	/**	 * @备注:	 * @字段:phone VARCHAR(13)	 */	private String callType;	/**	 * @备注:	 * @字段:gmt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date gmtDatetime;	/**	 * @备注:	 * @字段:upt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date uptDatetime ;	/**	 * 备注: 联系人姓名	 */	@TableField(exist = false)	private String userName;	/**	 * 备注: 联系人关系	 */	@TableField(exist = false)	private String link;	/**	 * 备注: 联系人id(为null说明 该条通话记录不在通讯录中)	 */	@TableField(exist = false)	private String pUserId;	/**	 * 备注: 联系人id(与用户id不匹配的话 说明该号码是其他通讯录)	 */	@TableField(exist = false)	private String listUserId;	/**	 * 备注: 呼叫次数	 */	@TableField(exist = false)	private java.lang.Integer callTimes;	public UserPhoneRecord(){	}	public UserPhoneRecord(		Long id	){		this.id = id;	}	public void setId(Long id) {		this.id = id;	}	public Long getId() {		return this.id;	}	public void setUserId(Long userId) {			this.userId = userId;			}	public Long getUserId() {			return this.userId;	}	public void setUser(User user) {		this.user = user;	}	public User getUser() {		return this.user;	}	public String getTaskId() {		return taskId;	}	public void setTaskId(String taskId) {		this.taskId = taskId;	}	public void setPhone(String phone) {		this.phone = phone;	}	public String getPhone() {		return this.phone;	}	public Date getGmtDatetime() {		return gmtDatetime;	}	public void setGmtDatetime(Date gmtDatetime) {		this.gmtDatetime = gmtDatetime;	}	public Date getUptDatetime() {		return uptDatetime;	}	public void setUptDatetime(Date uptDatetime) {		this.uptDatetime = uptDatetime;	}	public String getConnTimes() {		return connTimes;	}	public void setConnTimes(String connTimes) {		this.connTimes = connTimes;	}	public String getCommFee() {		return commFee;	}	public void setCommFee(String commFee) {		this.commFee = commFee;	}	public String getCallType() {		return callType;	}	public void setCallType(String callType) {		this.callType = callType;	}	public String getUserName() {		return userName;	}	public void setUserName(String userName) {		this.userName = userName;	}	public String getLink() {		return link;	}	public void setLink(String link) {		this.link = link;	}	public String getpUserId() {		return pUserId;	}	public void setpUserId(String pUserId) {		this.pUserId = pUserId;	}	public String getListUserId() {		return listUserId;	}	public void setListUserId(String listUserId) {		this.listUserId = listUserId;	}	public Integer getCallTimes() {		return callTimes;	}	public void setCallTimes(Integer callTimes) {		this.callTimes = callTimes;	}	@Override	public String toString() {		return "UserPhoneRecord{" +				"id=" + id +				", userId=" + userId +				", user=" + user +				", taskId='" + taskId + '\'' +				", phone='" + phone + '\'' +				", connTimes='" + connTimes + '\'' +				", commFee='" + commFee + '\'' +				", callType='" + callType + '\'' +				", gmtDatetime=" + gmtDatetime +				", uptDatetime=" + uptDatetime +				'}';	}}